        function onElementCreate(data)
        {   
            var params = jQuery.extend({
                selector: '',
                success: function() {},
                fail: function() {},
                continueListening: false,
                timeout: 500,
                limit: false
            }, data);

            if( jQuery(params.selector).length )
            {
                params.success(params.selector);
                if (!params.continueListening)
                {
                    return false;
                }
            }

            var i = 0;
            var interval = setInterval(function(){

                if( jQuery(params.selector).length )
                {
                    params.success(params.selector);
                    if( !params.continueListening )
                    {
                        clearInterval(interval);
                    }
                }
                if( params.limit && i > params.limit)
                {
                    clearInterval(interval);
                    params.fail(params.selector);
                }
                i++;
            }, params.timeout);
        }
        
        function countCharacters(el)
        {
            var enteredText = el.val();
            var numberOfLineBreaks = (enteredText.match(/\n/g)||[]).length;
            return enteredText.length + numberOfLineBreaks;
        }

